import React from "react";
import './headerMain.css';

function HeaderMain(){
    return(
        <header className="header-main">
            <nav className="header-nav">
                <li className="header-nav-li"><a className="header-nav-li-a" href="/#"><i class="fi fi-rr-house-chimney"></i></a>        </li>
                <li className="header-nav-li"><a className="header-nav-li-a" href="/#"><i class="fi fi-rr-user"></i></a></li>
                <li className="header-nav-li"><a className="header-nav-li-a" href="/#"></a></li>
                <li className="header-nav-li"><a className="header-nav-li-a" href="/#"></a></li>
                <li className="header-nav-li"><a className="header-nav-li-a" href="/#"></a></li>
                <li className="header-nav-li"><a className="header-nav-li-a" href="/#"></a></li>
            </nav>
        </header>
    );
};



export default HeaderMain;
